(5687, 1506598512, '只有完全不同的自己，\n才有完全不同的未来\n\n没有做出正确的判断，就没有办法做出真正该做的事\n\n\n\n中国公司尤其应该追求大道至简的方向，\n\n那就是做成毫不费力但是可能有巨大成功的公司。\n\n中国大多数公司的方法论是，天天血战还不能保证最后能成功', 1508240748, 1474205721, 2, 0, 0, 1513424748, 'none', ''),
(5688, 1506598585, '很多时候，我们看不穿、\n看不透事情的本质，因此会和现实妥协。\n\n从“看到”到“看穿”，是质的变化。\n\n之后，你的行动会变得简单了，对用户的理解也会清楚了。', 1506598585, 1474205721, 0, 0, 0, 0, 'none', ''),
