(5561, 1502410186, '我们在编程、阅读、思考的过程中，经常因为一条手机的通知，打开手机，回复短信，翻看微信朋友圈，微博，推特，Telegram，邮件，点掉所有的红点……\n\n等回到之前的场景，你会惊喜的发现至少半个小时过去了。很多人问我为什么能够持续写这么多文字，「我根本没有那么多时间啊」。\n\n不是没时间，而是大部分人无法做到专注。', 1509179328, 1474205721, 2, 0, 0, 1509265728, 'none', ''),
