(5917, 1511494835, 'pc//周星驰说过这样一句话：“我拍了很多悲剧，但你们都说那是喜剧。”是啊，这世上有太多南辕北辙。好恶之于你我，不过是两岸灯火。就像你喜欢拈花浅笑，而我喜欢把酒度宵。你喜欢荒凉大漠的广浩，而我偏爱这入目成诗的枯槁。就像是，你生活且还如意，而谈及我时，我只说了一句“别问了，过得不好。”', 1511512055, 1477888623, 0, 0, 0, 0, 'none', ''),
