(5605, 1503573178, '解决问题\n搁置法\n不是不做，是过一段时间再做\n\n不说死，就可以解决很多问题了\n自己和别人就不会那么抗拒，', 1511660152, 1477888623, 2, 0, 0, 1511689800, 'none', ''),
