(5983, 1513853235, '\n变换字符串，和格式化的时候可能丢失空格，可能造成不可用\n\n另\n\n每一个操作都可能对结果造成影响，\n保持敏感，对每一小步做出记录，\n包括每一次复制，\n保持淡定，\n主观猜测和方向不一定是对的，\n就像打游戏一般，\n跳出常规，\n怀疑所有自己曾经确信的所有观点 和\n所有细节\n\n\n ', 1513853235, 0, 0, 0, 0, 0, 'none', ''),
