(5991, 1516078637, '如果反过来，\n嫌弃我没有钱，我会说我做不到，\n这是价值不对等，\n为什么会走到价值上去，\n因为她生气就导致休息不好，\n影响了生命的效率，', 1516078637, 0, 0, 0, 0, 0, 'none', ''),
