(5994, 1516243875, '大部分事情还是要自己来 做决定\n她还是太小\n不太好做决断\n\n如果我按她的去\n会让事情更糟，她也无法承担后果和责任', 1516243875, 0, 0, 0, 0, 0, 'none', ''),
(4597, 1486224926, '至尊宝想起的紫霞仙子，\n唐僧想起的段小姐，\n都是已经不在身边的人。\n\n假如她们还在身边，她们都会因为变成取经的障碍而被放弃。', 1505907530, 98, 2, 0, 0, 1511091530, 'none', ''),
(5169, 1494499989, '主流价值观会影响自我评定\n\n自我和自由，\n我知道我想要什么，\n我也不想让主流价值观成为我的阻碍\n\n就像最近对得失的领悟，\n完全不是以前的那么简单粗暴\n\n主流价值观 的竞争标准 \n保持距离\n\n更长远 更开阔的坐标系里\n来选择自己的道路', 1505563967, 1474205721, 2, 0, 0, 1510747967, 'none', ''),
(5880, 1511232573, 'pc//昨天 有什么安排是没做好的？\n昨天收获了什么？\n\n这周想达成什么目标?\n这个月想达成什么目标？\n标准提问模版', 1514429321, 1477888623, 0, 0, 0, 0, 'none', ''),
(4613, 1486310058, '我的目标很简单，就是多赚钱，\n让所有人因为我的钱而爱上我，而不是单纯的看上我的善良，正直和美貌。', 1510484178, 1472049355, 2, 0, 0, 1518260178, 'none', ''),
