(6002, 1516760099, ' 不要说的太多\n\n控制得太多就会感觉很窒息\n\n把关键节点控制一下就好\n偶尔提醒一下\n\n主要是对状态 的把握\n而不是控制每一分钟的内容', 1516760099, 0, 0, 0, 0, 0, 'none', ''),
