(273, '\nvoice//核心战略和为知笔记有什么不同。\n\n核心专注的领域是 流畅，快速，自然，省心。\n\n1 语音翻译功能，只能听会很难找，而且还能暂停\n2 分类功能，带有二维空间的参数，以及颜色参数，更加容易找到东西\n3 提醒功能，不漏掉任何笔记，及时转化，而不是过期。结合有道词典浏览模式和莫莫。\n4 语音图片 和文字 混合，还能 给语音和文字混合的功能。\n5 个人曲线，对于自己的节奏有足够的掌握。再辅助计划系统，以及总结系统，这个月回顾上个月，这个看似简单，其实作用很大！。对自己的动机规划和执行有大数据支持。\n6智能提醒，智能总结，猜出你要找的。\n7微信接口，免登录，免注册。\n8使用小红点督促我们赶紧回顾和复习。', 1457981493, 36, 0, 0, '', 'oYD3iwOCt9XajrpSfV4BAC2beocg'),
(274, '编辑页面的ui肯定要改，至于怎么改，还是一个字，抄，抄谁的？估计这回得原创了。\n\n保存占得空间太大，没什么卵用。\n打字空间有限，上边必须留空。\n保存新建关闭统统放在第一行？还是让用户自己决定？\n播放，录音，停止 也放一行？\n而且事实证明根本用不到再分类…\n\n置顶太难理解，不如让我们选择，很重要，非常重要，直接放在提醒那一栏置顶。', 1457981440, 64, 0, 0, '', 'oYD3iwOCt9XajrpSfV4BAC2beocg'),
